            <img className="slide-background" src="src/image/plateau.jpg" alt="plateau de jeu fond"/>
            <img className="slide-bottom" src="src/image/plateau.jpg" alt="slide du plateau de jeu bottom"/>
        </div>
    )
}

export default LandingPage
